// src/App.js (FULL CODE - Added SearchDonors route)

import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// Import Components and Pages
import Header from "./components/Header";
import PrivateRoute from "./components/PrivateRoute";
import Register from "./pages/Register";
import DonorProfile from "./pages/DonorProfile";
import Login from "./pages/Login";
import SearchDonors from "./pages/SearchDonors"; // <-- NEW IMPORT

const App = () => {
  return (
    <Router>
      <Header />

      <div style={{ padding: "20px" }}>
        <Routes>
          {/* Default/Home Route */}
          <Route
            path="/"
            element={
              <div style={{ textAlign: "center", marginTop: "50px" }}>
                <h2>Welcome to the Blood Donation Network</h2>
                <p>
                  Your action saves lives. Use the links above to Register,
                  Login, or find a Donor.
                </p>
                <p style={{ marginTop: "20px", color: "#00796b" }}>
                  **TEST NOTE:** Try the new Find Donor feature!
                </p>
              </div>
            }
          />
          <Route path="/register" element={<Register />} />
          <Route path="/login" element={<Login />} />
          <Route path="/search" element={<SearchDonors />} />{" "}
          {/* <-- NEW ROUTE */}
          {/* PROTECTED ROUTE */}
          <Route
            path="/profile"
            element={<PrivateRoute element={DonorProfile} />}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
